import chess
import random

def simple_eval(board):
    # Simple evaluation function to assign a score to the board position.
    if board.is_checkmate():
        if board.turn:
            # Bot is checkmated
            return -10000
        else:
            # Opponent is checkmated
            return 10000
    elif board.is_stalemate() or board.is_insufficient_material() or board.is_seventyfive_moves() or board.is_fivefold_repetition():
        # Stalemate, 50-move draw, repetition, or insufficient material
        return 0

    score = 0

    # Evaluate material balance
    piece_values = {
        chess.PAWN: 0.87,
        chess.KNIGHT: 3.37,
        chess.BISHOP: 3.65,
        chess.ROOK: 4.77,
        chess.QUEEN: 10.25,
        chess.KING: 0
    }

    # Evaluate center control
    center_squares = [chess.E4, chess.D4, chess.E5, chess.D5, chess.C4, chess.C5]
    center_control_bonus = 0.5

    for square in chess.SQUARES:
        piece = board.piece_at(square)
        if piece:
            if piece.color == chess.WHITE:
                score += piece_values[piece.piece_type]
                if square in center_squares:
                    score += center_control_bonus
            else:
                score -= piece_values[piece.piece_type]
                if square in center_squares:
                    score -= center_control_bonus

    # Evaluate castling
    if board.has_queenside_castling_rights(chess.WHITE):
        score += 1
    if board.has_kingside_castling_rights(chess.WHITE):
        score += 1
    if board.has_queenside_castling_rights(chess.BLACK):
        score -= 1
    if board.has_kingside_castling_rights(chess.BLACK):
        score -= 1

    return score


def negamax(board, depth, alpha, beta, color):

    #Negamax algorithm implementation with alpha-beta pruning for move generation.

    if depth == 0 or board.is_game_over():
        return color * simple_eval(board)

    best_value = -float("inf")
    legal_moves = list(board.legal_moves)
    random.shuffle(legal_moves)

    for move in legal_moves:
        board.push(move)
        value = -negamax(board, depth - 1, -beta, -alpha, -color)
        board.pop()

        best_value = max(best_value, value)
        alpha = max(alpha, value)
        if alpha >= beta:
            break

    return best_value

def bot1_move(board):
    # Function to generate a move for Bot 1 using the Negamax algorithm with alpha-beta pruning.
    best_move = None
    best_value = -float("inf")
    legal_moves = list(board.legal_moves)

    for move in legal_moves:
        board.push(move)
        value = -negamax(board, depth=2, alpha=-float("inf"), beta=float("inf"), color=-1)
        board.pop()

        if value > best_value:
            best_value = value
            best_move = move

    return best_move

def bot2_move(board):
    # Function to generate a move for Bot 2 using the Negamax algorithm with alpha-beta pruning.
    best_move = None
    best_value = -float("inf")
    legal_moves = list(board.legal_moves)
    random.shuffle(legal_moves)  # Shuffle the legal moves

    for move in legal_moves:
        board.push(move)
        value = -negamax(board, depth=2, alpha=-float("inf"), beta=float("inf"), color=1)
        board.pop()

        if value > best_value:
            best_value = value
            best_move = move

    return best_move

