BOOK_LEN = len(BOOK) // 16

def get_opening(i: int) -> list[chess.Move]:
    assert 0 <= i < BOOK_LEN
    moves = []
    for i in range(i * 16, i * 16 + 16, 2):
        from_sq = BOOK[i]
        to_sq = BOOK[i + 1]
        if from_sq == to_sq:
            break
        moves.append(chess.Move(from_sq, to_sq))
    return moves

def random_opening() -> list[chess.Move]:
    return get_opening(random.randrange(0, BOOK_LEN))


def play_chess():
    board = chess.Board()
    moves_played = []

    move_number = 1

    # Get the opening moves for black and white
    opening_moves = random_opening()

    # Make the opening moves
    for move in opening_moves:
        algebraic_move = board.san(move)
        board.push(move)
        moves_played.append(f"{move_number}. {algebraic_move}")
        move_number += 1

    while not board.is_game_over():
        if board.turn:
            # It's Bot 1's turn to move
            print(board)
            move = bot1_move(board)
